                switch (step) {
                    case 0:
                    case 1:
                        return <Close sx={{ fontSize: ICON_SIZE }} />;
                    case 2:
                    case 3:
                    case 5:
                        return <ArrowBack sx={{ fontSize: ICON_SIZE }} />;
                    case 4:
                        return <></>;
                    default:
                        return <></>;
                }
};
